  input: '"TEXT","F3XA","","In response to your letter dated December 2, 2005, the
    transfer was reported on the original filing of this report on line 12, however,
    somehow it was not itemized.  That has been corrected for this amendment. With
    regard to the question regarding receipts versus the acutal transfer, the Commission''s
    regulations require a joint fundraising participant to ''report the date of receipt
    as the day the fundraising representative received the contribution.''  That date
    usually does not correspond to the date the participant actually receives the
    transfer from the joint fundraising representative.  So if the donor information
    is available to a joint fundraising participant prior to the time the participant
    receives its share of the gross receipts, then it seems to make sense for the
    joint fundraising participant to report those receipts as memo entries in the
    actual time period, clearly identifying them as receipts from a joint fundraising
    event, even though it may not receive a transfer of funds until a later date."'
